import React, { Component, PropTypes } from 'react'
import {
  Text,
  View,
  Image,
  TouchableOpacity,
  AsyncStorage,
  TextInput,
  Dimensions,
  ScrollView,
  Alert,
  Platform,
} from 'react-native'
import ImagePicker from 'react-native-image-picker'
import { Actions } from 'react-native-router-flux'
import dismissKeyboard from 'react-native-dismiss-keyboard'
import Spinner from 'react-native-loading-spinner-overlay'
import { connect } from 'react-redux'
import GoogleAnalytics from 'react-native-google-analytics-bridge'
import DeviceInfo from 'react-native-device-info'
import PhoneNumberPicker from 'react-native-country-code-telephone-input'
import {
  startSpinner,
  stopSpinner,
} from '../../actions/ValEduActions'
import styles from '../../utils/Styles'
import http from '../../utils/Http'
import { validateEmail, validatePhoneNumber, convertToIST } from '../../utils/Validations'
import Colors from '../../utils/Colors'
import Footer from '../Footer'

let userId
let token
let refreshToken

const img1 = ''
const img2 = ''
const img3 = ''
const img4 = ''
const img5 = ''
const img6 = ''
const img7 = ''
const img8 = ''
const img9 = ''
const base64 = ''

class ProfileInfo extends Component {
  constructor(props) {
    super(props)
    this.state = {
      name: '',
      email: '',
      date: convertToIST(new Date()),
      emailError: '',
      base64,
      errorText: '',
      phoneNumber: '',
      phoneError: '',
    }
  }

  componentDidMount() {
    AsyncStorage.setItem('updatedTables', 'true')
  }

  getProfileInfo = () => {
    dismissKeyboard()
    http('profileInfo', { userId }, 'POST', token)
    .then(async (response) => {
      if (response.status) {
        this.setState({
          email: response.email,
          name: response.name,
          phoneNumber: this.state.phoneNumber,
          date: response.birthDate,
          base64: response.profileImage,
        })
        try {
          await AsyncStorage.setItem('token', token)
          await AsyncStorage.setItem('userId', userId)
          await AsyncStorage.setItem('refreshToken', refreshToken)
          await AsyncStorage.setItem('name', response.name)
          await AsyncStorage.setItem('email', response.email)
          await AsyncStorage.setItem('profileImage', response.profileImage)
          await AsyncStorage.setItem('phoneNumber', this.state.phoneNumber)
        } catch (e) {}
        this.saveVersion()
        Actions.drawer()
      } else {
        // alert(response.Message)
      }
    })
    .catch((error) => {
      // alert(error)
    })
  }

  saveVersion = async () => {   
    try {
      token = await AsyncStorage.getItem('token')
      userId = await AsyncStorage.getItem('userId')     
      http('saveUserVersion', { userId, version: DeviceInfo.getVersion(), devicePlaform: Platform.OS }, 'POST', token)
      .then((response) => {
        if (response.status) {
        } 
      })
      .catch((error) => {
        // alert(error)
      })
    } catch (e) {}
  }

  gotoHome = () => {
    dismissKeyboard()
    const emailError = this.state.emailError
    const phoneError = this.state.phoneError
    let name = this.state.name
    let email = this.state.email
    this.setState({name: name.trim(), email: email.trim()})
    if (name === '' || !name.trim()) {
      this.refs.scrollview.scrollTo({ y: 0 })
      this.setState({ errorText: 'Name is required' })
      this.refs.name.focus()
    } else if (this.state.phoneNumber === '') {
      this.refs.scrollview.scrollTo({ y: 0 })
      this.setState({ errorText: 'Phone Number is required' })
    } else if (phoneError) {
      this.refs.scrollview.scrollTo({ y: 0 })
      this.setState({ errorText: 'Please enter a valid Phone Number' })
    } else if (email.trim() && emailError) {
      this.refs.scrollview.scrollTo({ y: 0 })
      this.setState({ errorText: 'Please enter valid email address' })
      this.refs.email.focus()
    } else if (!email.trim() || (email.trim() && !emailError) && !phoneError) {
      const { dispatch } = this.props
      dispatch(startSpinner())
      this.setState({ errorText: '' })
      const data = {
        email: this.state.email,
        name: this.state.name,
        phoneNumber: this.state.phoneNumber,
        birthDate: this.state.date,
        profileImage: this.state.base64,
      }
      if (this.props.reach === 'NONE') {
        Alert.alert(
          'Balagokulam - Seekho Sikhao',
          'Please connect to internet for accessing the app',
          [
            { text: 'OK' },
          ]
        )
        dispatch(stopSpinner())
      } else {
        http('registerUser', data)
        .then(async (response) => {
          // alert(JSON.stringify(response))
          dispatch(stopSpinner())
          if (response.status) {
            if(response.isActive && response.access_token) {
              try {          
              AsyncStorage.setItem('token', response.access_token)
              AsyncStorage.setItem('refreshToken', response.refresh_token)
              AsyncStorage.setItem('userId', response.userId)
              AsyncStorage.setItem('name', data.name)
              AsyncStorage.setItem('email', data.email)
              // AsyncStorage.setItem('birthDate', data.birthDate)
              AsyncStorage.setItem('profileImage', data.profileImage)
              AsyncStorage.setItem('phoneNumber', this.state.phoneNumber)
              GoogleAnalytics.trackEvent('Registration', 'new user')
              } catch (e) {}         
              this.saveVersion()
              Actions.drawer()
            } else {
              this.verifyPhone()
            // alert('error occured' + JSON.stringify(response))
            }
          }
        })
        .catch((error) => {
          // alert(error)
        })
      }
    }
  }

  PhoneNumberPickerChanged = async (country, callingCode, phoneNumber) => {
    const phoneError = validatePhoneNumber(phoneNumber)
    const num = '+' + callingCode + '-' + phoneNumber
    this.setState({ phoneNumber: callingCode + phoneNumber, phoneError })

    if(phoneNumber.length == 10) {
      dismissKeyboard()           
      await AsyncStorage.setItem('phoneNumber', num)
      this.verifyPhone()
    }
  }

  /*phoneNumOnChange = (event) => {
    const phoneNumber = event.nativeEvent.text
    const phoneError = validatePhoneNumber(phoneNumber)
    this.setState({ phoneNumber, phoneError })
  }*/

  selectAvatar = (err, base64) => {
    // alert(err + base64)
    this.setState({base64})
  }

  emailOnChange = (event) => {
    const email = event.nativeEvent.text
    const emailError = validateEmail(email)
    this.setState({ email, emailError })
  }

  verifyPhone = () => {
    const phoneError = this.state.phoneError
    if(!phoneError) {
      dismissKeyboard()
      if (this.props.reach === 'NONE') {
        Alert.alert(
        'Balagokulam - Seekho Sikhao',
        'Please connect to internet for accessing the app',
        [
          { text: 'OK'},
        ]
      )
      } else {
        const data = {
          phoneNumber: this.state.phoneNumber,
          devicePlatform: Platform.OS,
        }
        const data1 = {
          phoneNumber: this.state.phoneNumber,
          deviceUdId: DeviceInfo.getUniqueID(),
        } 
        http('sendotp', data).then(async (response) => {

          if (response.status && response.isAlreadyRegistered) {
            const isRegistered = response.isAlreadyRegistered
            if (!response.isActive) {
              Alert.alert(
                'An account with this number already exists',
                'Do you want to reactivate your account?',
                [
                  { text: 'CANCEL' },
                  { text: 'OK', onPress: () => {
                    http('reactivateAccount', data1).then((result) => {
                      if (result.status && isRegistered) {
                        userId = result.loginResponse.userId
                        refreshToken = result.loginResponse.refresh_token
                        token = result.loginResponse.access_token
                        this.getProfileInfo()
                      }
                    })
                    .catch((error) => {
                      //alert(error)
                    })
                  } },
                ],
                { cancelable: false }
              )
            } else {
              userId = response.loginResponse.userId
              refreshToken = response.loginResponse.refresh_token
              token = response.loginResponse.access_token
              this.getProfileInfo()             
            }        
          } else {
            this.refs.email.focus()
          }
        })
        .catch((error) => {
          // alert(error)
        })
      }
    }
  }
  
  openGallery = () => {
    const options = {
      title: 'Choose your profile picture',
      takePhotoButtonTitle: 'Take Photo',
      chooseFromLibraryButtonTitle: 'Choose from Library',
      quality: 1,
      maxWidth: 600,
      maxHeight: 300,
      allowsEditing: true,
      storageOptions: {
        skipBackup: true,
      },
    }
    ImagePicker.showImagePicker(options, (response) => {
      if (response.didCancel) {
        // console.log('User cancelled photo picker')
      } else if (response.error) {
        // console.log('ImagePicker Error: ', response.error)
      } else if (response.customButton) {
        // console.log('User tapped custom button: ', response.customButton)
      } else {
        this.setState({ base64: response.data })
        const source = { uri: 'data:image/jpeg;base64,' + response.data, isStatic: true }
        this.setState({
          source,
        })
      }
    })
  }

  render() {
    return (
      <View style={[styles.container, { backgroundColor: 'rgb(255, 240, 165)' }]}>
        <ScrollView
          ref="scrollview"
          showsVerticalScrollIndicator={false}
          keyboardShouldPersistTaps={true}
        >
          <Text style={styles.errorText}>{this.state.errorText}</Text>
          <Text style={[styles.textColor, { fontSize: 17 }]}>Please provide your Name and optional E-mail
            for your Profile information.
          </Text>
          <View style={styles.spaceContainer}>
            <Text style={[styles.textColor, { marginTop: 15 }]}>Name: </Text>
            <View style={[styles.textInput, { flex: 1 }]}>
              <TextInput
                ref="name"
                style={{ height: 40 }}
                onChangeText={(name) => this.setState({ name })}
                value={this.state.name}
                maxLength={25}
                placeholderTextColor={Colors.textColor}
                underlineColorAndroid="rgb(182, 73, 38)"
                autoCapitalize="words"
                onSubmitEditing={(e) => {
                  // this.refs.phn.focus()
                }}
              />
            </View>
          </View>
          <View style={styles.spaceContainer}>
            <Text style={[styles.textColor, { marginTop: 15 }]}>Mobile Number: </Text>
            <View style={[styles.textInput, { flex: 1 }]}>
              <PhoneNumberPicker
                countryHint={{ name: 'India', cca2: 'IN', callingCode: '91' }}
                onChange={this.PhoneNumberPickerChanged}
              />
            </View>
          </View>
          <View style={styles.spaceContainer}>
            <Text style={[styles.textColor, { marginTop: 15 }]}>Email: </Text>
            <View style={[styles.textInput, { flex: 1 }]}>
              <TextInput
                ref="email"
                style={{ height: 40 }}
                onChange={this.emailOnChange}
                value={this.state.email}
                placeholderTextColor={Colors.textColor}
                underlineColorAndroid="rgb(182, 73, 38)"
                keyboardType="email-address"
              />
            </View>
          </View>
          <Text style={[styles.textColor, { fontSize: 17, marginTop: 15 }]}>
            Please upload your pic, or choose one of the following avtars.
          </Text>
          <View style={styles.spaceAround}>
            <TouchableOpacity onPress={this.openGallery}>
              <Image
                source={{ uri: 'data:image/png;base64,' + this.state.base64, isStatic: true }}
                style={[styles.profileIcon, { marginTop: 40 }]}
              />
            </TouchableOpacity>
            <View style={styles.spaceContainer}>
              <View style={{ padding: 10 }}>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img1 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img1, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img2 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img2, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img3 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img3, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
              </View>
              <View style={{ padding: 10 }}>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img4 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img4, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img5 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img5, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img6 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img6, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
              </View>
              <View style={{ padding: 10 }}>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img7 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img7, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img8 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img8, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ base64: img9 })
                  }}
                >
                  <Image
                    source={{ uri: 'data:image/png;base64,' + img9, isStatic: true }}
                    style={styles.avatarIcon}
                  />
                </TouchableOpacity>
              </View>
            </View>
          </View>
          <View style={{ marginBottom: 15 }}>
            <TouchableOpacity
              onPress={this.gotoHome}
              style={[styles.loginbutton, { backgroundColor: 'rgb(224, 110, 56)' }]}
            >
              <Text style={styles.buttonText}>
                Next
              </Text>
            </TouchableOpacity>
            { this.props.success ? <View /> :
              <Spinner visible={true} color="rgb(182, 73, 38)" overlayColor={'transparent'} />}
          </View>
        </ScrollView>
        <Footer />
      </View>
    )
  }
}

ProfileInfo.propTypes = {
  success: PropTypes.bool,
  dispatch: PropTypes.func,
  phoneNumber: PropTypes.number,
  reach: PropTypes.string,
}

function mapStateToProps(state) {
  return {
    success: state.ValEdu.get('success'),
    reach: state.ValEdu.get('reach'),
  }
}
export default connect(mapStateToProps)(ProfileInfo)
